import './App.css';
import React from 'react';
import {useState, useEffect} from 'react';
import axios from 'axios';



const App = () => {



const [gigs, setGigs] = useState([]);

useEffect(() => {
    axios
      .get('http://localhost:8080/previousGigs')
      .then((response) => {
        setGigs(response.data)
        })
  }, []);



  return (
    <div className="home">
      <h1>Gig History</h1>
            {gigs.map((gig) => {
              return (
              <div className="gig" key={gig.id}>
              <h1>{gig.title}</h1>
              </div>
            )
            })}
    </div>
  );
}

export default App;
